import { Box, Heading } from "@chakra-ui/react";
import { useParams } from "react-router-dom";

export const ConfirmationPage = () => {
  let params = useParams();

  return (
    <Box>
      <Heading>the id of this course is {params.courseId} , thanks!</Heading>
    </Box>
  );
};
